export default function Logout(){

  useEffect(()=>{
    const user = localStorage.getItem("user");
    if(user) {
      localStorage.removeItem("user");
    }
  },[])

  return (
    <div className="sign-in">
      <h1>Logout</h1>
    </div>
  )
}
